import React from "react";
import './ChanteuseComponent.css';
import Footer from '../Footer/Footer';
import { Link } from "react-router-dom";
import { MDBCard, MDBCardBody, MDBCol, MDBRow, MDBContainer } from "mdbreact";


const ChanteuseComponent = () => {
return (
  <div className="ChanteuseComponent">
<MDBContainer>
  <MDBRow>
    <MDBCol md="6" className="mb-4">

      <MDBCard color="indigo" text="white" className="text-center">
        <MDBCardBody>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer
          posuere erat a ante.
        </MDBCardBody>
      </MDBCard>

      <MDBCard color="pink lighten-2" text="white" className="text-center">
        <MDBCardBody>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer
          posuere erat a ante.
        </MDBCardBody>
      </MDBCard>

      <MDBCard color="info-color" text="white" className="text-center">
        <MDBCardBody>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer
          posuere erat a ante.
        </MDBCardBody>
      </MDBCard>

    </MDBCol>
  </MDBRow>
</MDBContainer>
    </div>
  )
};

export default ChanteuseComponent;
